const ratio = pixels[0].length / canvas.width;


function drawPlainImage() {
	for (let y = 0; y < pixels.length; y++) {
		for (let x = 0; x < pixels[0].length; x++) {
			c.strokeStyle = rgb(pixels[y][x][0], pixels[y][x][1], pixels[y][x][2]);
			c.beginPath();
			c.rect(y, x, 1, 1);
			c.stroke();
		}
	}
}

function getDistance(x1, y1, x2, y2) {
	return Math.sqrt(Math.abs(x2 - x1) ** 2 + Math.abs(y2 - y1) ** 2);
}

function rgb(r, g, b) {
	return "rgba(" + r.toString() + "," + g.toString() + "," + b.toString() + ",1)";
}

function squish(value, in_min, in_max, out_min, out_max) {
    let in_range = in_max - in_min;
    let out_range = out_max - out_min;
    let percent_done = (value - in_min) / in_range;
    return out_range * percent_done + out_min;
}

function crop(data, x_start, y_start) {
	let size = parseInt(data.length / 2);

	let start_vertical = squish(y_start, 0, 599, 0, 49);
	let vertical_slice = data.slice(start_vertical, start_vertical + pixels[0].length / 2);
	console.log(vertical_slice);
	let horizontal_slice = [];
	for (let row of vertical_slice) {
		horizontal_slice.push(x_start, x_start + 25);
	}
	return horizontal_slice;
}

function mean(data) {
	let sum = 0;
	for (let item of data) {
		sum += item;
	}
	return parseInt(sum / data.length);
}

function getAverageColour(data) {
	let r_pixels = [];
	let g_pixels = [];
	let b_pixels = [];

	for (let y = 0; y < data.length; y++) {
		for (let x = 0; x < data[0].length; x++) {
			r_pixels.push(data[y][x][0]);
			g_pixels.push(data[y][x][1]);
			b_pixels.push(data[y][x][2]);
		}
	}
	return rgb(mean(r_pixels), mean(g_pixels), mean(b_pixels));
}

class Circle {
	constructor(x, y, radius, colour, area) {
		this.x = x;
		this.y = y;
		this.radius = radius;
		this.colour = colour;
		this.area = area;
	}

	draw() {
		c.beginPath();
      	c.arc(this.x, this.y, this.radius, 0, 2 * Math.PI, false);
      	c.fillStyle = this.colour;
      	c.fill(); 
	}
}

var circles = [new Circle(canvas.width / 2, canvas.height / 2, canvas.width / 2, getAverageColour(pixels), pixels)];
canvas.addEventListener("mousemove", (event) => {
	let rect = canvas.getBoundingClientRect();
	update(parseInt(event.clientX - rect.left), parseInt(event.clientY - rect.top));
});

function update(x, y) {
	c.clearRect(0, 0, canvas.width, canvas.height);
	let next_circles = [];
	for (let circle of circles) {
		circle.draw();

		if (circle.radius > 3 && getDistance(x, y, circle.x, circle.y) < circle.radius) { // mouse inside of circle !!
			let directions = [[1, 1], [1, -1], [-1, 1], [-1, -1]];

			for (let d of directions) {
				let start_x = circle.x;
				if (directions[0] == -1) {
					start_x = circle.x - circle.radius;
				}
				let start_y = circle.y;
				if (directions[1] == -1) {
					start_y = circle.y - circle.radius;
				}

				let area = crop(circle.area, start_x, start_y);
				next_circles.push(new Circle(
					circle.x + (parseInt(circle.radius / 2) * d[0]),
					circle.y + (parseInt(circle.radius / 2) * d[1]),
					parseInt(circle.radius / 2),
					getAverageColour(area),
					area
				));
			}
		} else {
			next_circles.push(circle);
		}
	}

	//console.log(next_circles);
	circles = next_circles;
	next_circles = [];

	//console.log(x, y);
}

update(0, 0);
